import React from "react";
import styles from "./Header.module.scss";
import Button from "../Button";
import svg from "../../assets/img/LiveDune.svg";
import { Link } from "react-router-dom";
import { useDispatch } from "react-redux";
import { setError } from "../../Redux/Store/authSlice";

const Header = () => {
  const dispatch = useDispatch();
  const clearStates = () => {
    dispatch(setError(false));
  };
  return (
    <div className={styles.wrapper}>
      <Link to="/">
        <img className={styles.logo} src={svg} alt="" />
      </Link>
      <div className={styles.flexWrap}>
        <div className={styles.notAccount}>У вас нет акканута?</div>
        <div className={styles.btnWrapper}>
          <Link to="/registration">
            <Button change={() => clearStates()}>Регистрация</Button>
          </Link>
        </div>
      </div>
    </div>
  );
};
export default Header;
